script: |
  super -f text -I q12368.spq | sort > q12368.out

inputs:
  - name: q12368.spq
    data: |
      SELECT DISTINCT + ( + + 69 ) AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( ( NOT + col1 NOT BETWEEN + + col2 AND - col0 + + 28 ) );
  - name: tab2

outputs:
  - name: q12368.out
    data: |
      69
